import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <div id="titlebar" >
          <a id="title" href="localhost:3000" >
            <img src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSN5v82ItwB6nsdJENubF-SxHe7XTL1hg7p0A&usqp=CAU" width="319" height="79"/>
          </a>
        </div>
        <div id="titlebar">
          <ul id="chatLog"></ul>
            <form action="" id="sendForm">
              <input name="message" autocomplete="off" /><button>전송</button>
            </form>
        </div>
      </header>
    </div>
  );
}

export default App;
